import React, { useState } from "react";
import "./App.css";
import ReactMapGL from "react-map-gl";

function App() {
  const [viewport, setViewport] = useState({
    width: 400,
    height: 400,
    latitude: 37.7577,
    longitude: -122.4376,
    zoom: 8,
  });
  return (
    <div className="App">
        <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={process.env}
        onViewportChange={nextViewport => setViewport(nextViewport)}/>
    </div>
  );
}

export default App;
